(163, 285, 'Lightbox', 'lightbox', 'With our 4 different style Lightbox : img-rounded, img-circle, img-thumbnail, shadow and borderInner.\r\neffects.\r\n<div class="bs-docs-example">\r\n \r\n    [lightbox src="images/shortcode/4.png" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" ]\r\n      [lightbox src="images/shortcode/7.png" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="img-rounded" ] \r\n     [lightbox src="images/shortcode/1.png" width="190" height="190" lightbox="on"  align="left" style="img-circle" ]  [clear]\r\n     [lightbox src="images/shortcode/9.png" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="img-thumbnail" ] \r\n    [lightbox src="images/shortcode/5.png" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="borderInner" ]\r\n    [lightbox src="images/shortcode/6.png" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="shadow"]\r\n   \r\n</div>\r\n<pre class="prettyprint linenums">&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" &gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="img-rounded" &gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="img-circle" &gt;\r\n\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="img-thumbnail" &gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="borderInner"&gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="shadow"&gt;\r\n</pre>\r\n\r\n<!----------------------- Block space-------------------->\r\n\r\n<div class="bs-docs-example">\r\n[lightbox src="images/shortcode/1.png" width="200" height="200" lightbox="on" title="Nullam ultrices" align="left"]\r\n<h4>Nulla ac convallis ipsum</h4>\r\n<p>\r\nNulla ac convallis ipsum. Nulla tellus erat, dapibus in auctor quis, aliquet a magna.\r\nUt tortor nisl; pellentesque a rhoncus non, semper a quam. Sed aliquet libero at lorem ornare auctor ornare est condimentum.\r\n</p>\r\n<p>\r\nMorbi pulvinar nibh egestas massa venenatis sed condimentum turpis suscipit. In hac habitasse platea dictumst. Quisque quis odio a odio porttitor mattis! Donec id elit nec massa ornare dictum.\r\n</p>\r\n\r\n</div>\r\n<pre class="prettyprint linenums">&#91;lightbox src=''IMAGE_SRC''  width="200" height="200" lightbox="on" align="left" title="IMAGE_TITLE"&#93; </pre>\r\n\r\n<!----------------------- Block space-------------------->\r\n<div class="bs-docs-example">\r\n[lightbox src="images/shortcode/2.png" width="200" height="200" lightbox="on" title="IMAGE_TITLE" align="right"]\r\n<h4>Nulla ac convallis ipsum</h4>\r\n<p>\r\nNulla ac convallis ipsum. Nulla tellus erat, dapibus in auctor quis, aliquet a magna.\r\nUt tortor nisl; pellentesque a rhoncus non, semper a quam. Sed aliquet libero at lorem ornare auctor ornare est condimentum.\r\n</p>\r\n<p>\r\nMorbi pulvinar nibh egestas massa venenatis sed condimentum turpis suscipit. In hac habitasse platea dictumst. Quisque quis odio a odio porttitor mattis! Donec id elit nec massa ornare dictum.\r\n</p>\r\n\r\n</div>\r\n<pre class="prettyprint linenums">&#91;lightbox src=''IMAGE_SRC''  width="200" height="200" lightbox="on" align="right" title="IMAGE_TITLE"&#93; </pre>\r\n', '', 1, 90, '2013-02-22 23:05:21', 558, '', '2014-08-05 15:34:53', 558, 0, '0000-00-00 00:00:00', '2013-02-22 23:05:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_ti