(165, 287, 'Social Buttons', 'social-buttons', '[message_box type="warning" close="no"]\r\n<p>Ex: element type="facebook" then name of icons is "fa-facebook".</p>\r\nYou can find the full examples of usage at Font Awesome - <a href="http://fortawesome.github.io/Font-Awesome/icons/" target="_blank">Font Awesome 4.0.3</a> \r\n[/message_box]\r\n\r\n<div class="bs-docs-example">\r\n<p>\r\n[social type="facebook" ] #[/social]\r\n[social type="twitter" ]#[/social]\r\n[social type="google-plus"]#[/social]\r\n[social type="pinterest" ]#[/social]\r\n[social type="dribbble" ]#[/social]\r\n\r\n[social type="flickr" title="Follow us on Flickr"]#[/social]\r\n[social type="linkedin" title="Follow us on Linkedin"]#[/social]\r\n[social type="rss" title="Follow us on Rss"]#[/social]\r\n[social type="skype" title="Follow us on Skype"]#[/social]\r\n[social type="youtube" title="Follow us on Youtube"]#[/social]\r\n\r\n</p>\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;social type="facebook"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="twitter"&#93; PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="google-plus"&#93;      PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="pinterest"&#93;       PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="dribbble"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n\r\n&#91;social type="flickr" title="ADD_TITLE_HERE" &#93;  PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="linkedin" title="ADD_TITLE_HERE" &#93;     PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="rss" title="ADD_TITLE_HERE" &#93;      PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="skype" title="ADD_TITLE_HERE" &#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="youtube" title="ADD_TITLE_HERE" &#93; PLACE_LINK_HERE &#91;/social&#93;\r\n\r\n</pre>\r\n\r\n<!----------------------- Block space Min-------------------->\r\n\r\n<div class="bs-docs-example">\r\n[social type="facebook" style="min"]#[/social]\r\n[social type="t