(174, 296, 'icons', 'icons', '<!-- Icons\r\n================================================== -->\r\n     <h3 class="page-head">Font Awesome 4.0.3</h3>\r\n     <p>Font Awesome is a pictographic language of web-related actions which delivers 369 icons. The Font Awesome webfont, CSS, and LESS files are licensed under CC BY 3.0. You can find the full examples of usage at Font Awesome - <a target="_blank" href="http://fortawesome.github.io/Font-Awesome/icons/">Font Awesome 4.0.3</a></p>\r\n \r\n     \r\n     <div class="bs-docs-example">               \r\n          <div class="row-fluid">\r\n                <div class="col-lg-2">\r\n                 [icon name="twitter" size="34" color="#0AA7DB" ] \r\n                 \r\n                </div>\r\n                <div class="col-lg-2">\r\n                  [icon name="facebook" size="34" color="#0AA7DB" ] \r\n                </div>\r\n                <div class="col-lg-2">\r\n                 [icon name="linkedin " size="34" color="#0AA7DB" ]\r\n                </div>\r\n          </div>\r\n     </div>\r\n      <pre class="prettyprint linenums">&#91;icon name="twitter"  size="34" color="#0AA7DB"  &#93; \r\n&#91;icon name="facebook" size="34" color="#3C5A9A" &#93;\r\n&#91;icon name="linkedin" size="34" color="#1B5690" &#93;\r\n</pre>\r\n\r\n       [message_box type="warning" close="no"]\r\n<p>Ex: element name="user" then name of icons is "fa-user".</p>\r\nYou can find the full examples of usage at Font Awesome - <a href="http://fortawesome.github.io/Font-Awesome/icons/" target="_blank">Font Awesome 4.0.3</a> \r\n[/message_box]\r\n     <h3 class="page-head">Glyphicons</h3>\r\n     <p>Includes 200 glyphs in font format from the Glyphicon Halflings set. Glyphicons Halflings are normally not available for free, but their creator has made them available for Bootstrap free of cost. As a thank you, we only ask that you to include a link back to Glyphicons whenever possible.You can find the full examples of usage at Glyphicons 