(253, 367, 'Advantages', '', '<div class="item item1 col-sm-4" data-scroll-reveal="enter left move 0px wait 0.2s">\r\n<div class="item-image"><img src="images/demo/advantage01.png" alt="" /></div>\r\n<h3 class="item-title">Unique &amp; Creative Design</h3>\r\n<div class="seperator"> </div>\r\n<div class="item-desc">Our design is powerfully useful. You can easily use one design for various purposes. It''s flexible architecture allows you to build complex templates in no time. Extending your web design cannot be faster.ipsum</div>\r\n</div>\r\n<div class="item item2 col-sm-4" data-scroll-reveal="enter left move 0px wait 0.4s">\r\n<div class="item-image"><img src="images/demo/advantage02.png" alt="" /></div>\r\n<h3 class="item-title">Unique &amp; Creative Design</h3>\r\n<div class="seperator"> </div>\r\n<div class="item-desc">Go go to themes and select Customize and you can add your own logo, background and then select the colors used everywhere in the theme. It’s so simple and powerful. You can literally change the entire</div>\r\n</div>\r\n<div class="item item3 col-sm-4" data-scroll-reveal="enter left move 0px wait 0.6s">\r\n<div class="item-image"><img src="images/demo/advantage03.png" alt="" /></div>\r\n<h3 class="item-title">Unique &amp; Creative Design</h3>\r\n<div class="seperator"> </div>\r\n<div class="item-desc">Designing and organizing your posts has never been easier. With our large collection of shortcodes, you can create beautiful and complex layouts with ease. This will greatly improve the functionality and variety</div>\r\n</div>', 1, 'bottom1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
